import React from 'react';
import './OvenItem.css';
import Loader from "../reusableComponents/Loader";

const OvenItem=(props)=>{

    let ovenview=null;
    if(props.ovenData.length>0 && props.setupData.length>0)
    ovenview=  <div className="oven-wrapper">
        <div className="oven-section1">
            <div>{props.ovenData.State}</div>
            <div>{props.ovenData.Name}</div>
            <div> {props.ovenData.CurrentTemperature}</div>
        </div>
        <div className="oven-section2">
            profile
        </div>
        <div className="oven-section3">
            <div>ready</div>
            <div>available</div>
            <div>found</div>
            <div>NF</div>
            <div>NA</div>
        </div>
        <div className="oven-section4">
            analytics
        </div>
    </div>


    return(
        <div>{ovenview!=null ? (
        {ovenview}

    ):(
            <Loader/>
    )
    }
        </div>
    )
}

export default OvenItem;
